		start_live:function(){
			Log.add('start live');
			if($('#update-search').hasClass('disabled')){
				Log.add('start live: already running, do not run again');
				return;
			}
			View.errors.clean();
			oAPI.OnReadyStep2(Step2.controller.ready_callback);
			$('#update-search').addClass('disabled');
			Step2.controller.start_live_timeout=setTimeout(Step2.controller.api_timeout,30000);
			oAPI.GetStep2(
				Step2.data.CategoryTypeID
				,$('#PickupLocationID').val()
				,$('#PickupDate').val()
				,Step2.data.PickupTime
				,$('#DropOffLocationID').val()
				,$('#ReturnDate').val()
				,Step2.data.ReturnTime
				,Step2.data.Age
				// ,$('#DriverAge').val()
				,Step2.data.PromoCode
				,1
			);
			$('#search-form:not(.load-show)').slideUp(400,function() {					   
				$('.nav-wrap nav').removeClass('unrounded');
			});
			$('#search-form').removeClass('load-show');
			// $('#search-form-margin').show();
			Log.add('end live');
			return;
		},
		collapse_search:function(){
			if(View.css_type()!='mobile'){
				return;
			}
			Step2.data.pickup_height=$($('form > div').get(0)).height();
			Step2.data.return_height=$($('form > div').get(1)).height();
			$($('form > div').get(0)).animate({height:0},'linear');
			$($('form > div').get(1)).animate({height:0},'linear');
			// $('#update-search').hide();
			// $('#change-search').show();
		},
		change_search:function(){
			if(!Step2.data.pickup_height||View.css_type()!='mobile'){
				$($('form > div').get(0)).css('height','auto');
				$($('form > div').get(1)).css('height','auto');
				return;
			}
			$($('form > div').get(0)).animate({height:Step2.data.pickup_height},'linear',function(){
				$($('form > div').get(0)).css('height','auto');
			});
			$($('form > div').get(1)).animate({height:Step2.data.return_height},'linear',function(){
				$($('form > div').get(1)).css('height','auto');
			});
			$('#update-search').show();
			$('#change-search').hide();
		},
		check_location_minimumbookingday:function(locationInfo,pickup_date_object,return_date_object,pickupId,returnId){
			var minimumbookingday=0;
			for(var i in locationInfo){
				if(locationInfo[i].id!=pickupId&&locationInfo[i].id!=returnId){
					continue;
				}
				if(parseFloat(locationInfo[i].minimumbookingday)>minimumbookingday){
					minimumbookingday=parseInt(locationInfo[i].minimumbookingday);
				}
			}
			var diff=(return_date_object.getTime()-pickup_date_object.getTime())/86400000;
			if(Number(diff)<Number(minimumbookingday)){
				return [Template.run('Minimum rental period is %minimumbookingday days.',{minimumbookingday:minimumbookingday})];
			}
			return [];
		},
		check_location_minimumbookingday_outside_us:function(driverlicence,pickup_date_object,return_date_object,pickupId,returnId){
			
			var nonus=["1","2","3"];
			var diff=(return_date_object.getTime()-pickup_date_object.getTime())/86400000;
			
			if(driverlicence==0){
				return ['Please select Driver Licence'];
			}else if( $.inArray(driverlicence, nonus) === -1 && pickupId == returnId && Number(diff)<5 ){
				return ['Hey there  our minimum hire for same city returns are 5 days  please adjust your travel dates for a quote - many thanks.'];
			}else if($.inArray(driverlicence, nonus) === -1 && pickupId != returnId && Number(diff)<7 ){
				return ['Hey there  our minimum hire days for one-way rentals are 7 days  please adjust your travel dates for a quote  many thanks'];
			}
			return [];
		},
		check_validatoin_period_of_booking_date:function(pickup_date_object,return_date_object){					
			// var checkIn_date=0;
			if( pickup_date_object < new Date(2019,1,1)){ //valid date is after 1st february 2019 
				return ['Our business opens officially on the 1st of February 2019  sadly we are unable to provide you with any quotes until then.'];
			}
			return [];
		},
		load_location:function(locationInfo,selected,check,caption){
			var opts=[
				Select.option_object(caption,'',true)
			];
			for(var i in locationInfo){
				if(locationInfo[i][check]) {
                    opts.push(Select.option_object(locationInfo[i].location, locationInfo[i].id));
                }
			}
			return Select.html(opts,selected);
		},
